import React from 'react';
import './App.css';
import AccessibleForm from './AccessibleForm';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
            <Link to="/signup" aria-label="Sign up for a new account">Sign Up</Link>
            </li>
            <li>
            <Link to="/signin" aria-label="Sign in to your account">Sign In</Link>
            </li>
          </ul>
        </nav>
        {/* Routes replaces Switch in v6 */}
        <Routes>
          <Route path="/signup" element={<AccessibleForm formType="signup" />} />
          <Route path="/signin" element={<AccessibleForm formType="signin" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
